import React from 'react';

function Chat(props) {
    console.log(new Date(props.timestamp * 1000).getTime())
    return (
        <div>
            <img src={props.avatar} alt={props.name} />
            <p>{props.name}</p>
            <p>{props.message}</p>
        </div>

    )
}

// Chat-type based
// Figure out timestamps later
// Figure out how to do message

function message (props) {
    switch (props.type) {
        case 'thumbs-up':
            return (
                <p>{props.name} gave a thumbs up!</p>
            );
            break;
        case 'thumbs-down':
            return (
                <p>{props.name} gave a thumbs down!</p>
            )

        default:
            return (
                <p>{props.message}</p>
            )
    }
}

export default Chat;
